import "./NF.css";
function NotFound() {
  return (
    <div>
      <div className="container text-center">
        <h1 className="title">Page Not Found</h1>
        <p className="desc">
          Foster meaningful relationships with events, newsletters, and
          community analytics
        </p>
        <button href="/" className="btn mt-1"> Homepage</button>
      </div>
    </div>
  );
}
export default NotFound;
